import {
  Box,
  Divider,
  Drawer,
  FormControl,
  InputLabel,
  List,
  ListItem,
  MenuItem,
  Select,
  Toolbar,
} from '@mui/material';
import { EXPLORE_SIDE_PANEL_WIDTH } from '../consts';
import { Filters } from './types';

export const FilterSidePanel = ({
  filters,
  setFilters,
}: {
  filters: Filters;
  setFilters: React.Dispatch<React.SetStateAction<Filters>>;
}) => {
  return (
    <Box
      component='nav'
      sx={{ width: { sm: EXPLORE_SIDE_PANEL_WIDTH }, flexShrink: { sm: 0 } }}
      aria-label='mailbox folders'
    >
      <Drawer
        variant='permanent'
        sx={{
          display: { xs: 'none', sm: 'block' },
          '& .MuiDrawer-paper': { boxSizing: 'border-box', width: EXPLORE_SIDE_PANEL_WIDTH },
        }}
        open
      >
        <div>
          <Toolbar />

          <Divider />

          <List>
            <ListItem>
              <FormControl fullWidth size='small'>
                <InputLabel id='type-label'>Meal Type</InputLabel>
                <Select
                  labelId='type-label'
                  id='type'
                  value={filters.type}
                  label='Meal Type'
                  onChange={(next) => {
                    setFilters((filters) => ({ ...filters, type: next.target.value }));
                  }}
                >
                  <MenuItem value={'main course'}>Main Course</MenuItem>
                  <MenuItem value={'side dish'}>Side Dish</MenuItem>
                  <MenuItem value={'dessert'}>Dessert</MenuItem>
                  <MenuItem value={'appetizer'}>Appetizer</MenuItem>
                  <MenuItem value={'salad'}>Salad</MenuItem>
                  <MenuItem value={'bread'}>Bread</MenuItem>
                  <MenuItem value={'breakfast'}>Breakfast</MenuItem>
                  <MenuItem value={'soup'}>Soup</MenuItem>
                  <MenuItem value={'beverage'}>Beverage</MenuItem>
                  <MenuItem value={'sauce'}>Sauce</MenuItem>
                  <MenuItem value={'marinade'}>Marinade</MenuItem>
                  <MenuItem value={'fingerfood'}>Fingerfood</MenuItem>
                  <MenuItem value={'snack'}>Snack</MenuItem>
                  <MenuItem value={'drink'}>Drink</MenuItem>
                </Select>
              </FormControl>
            </ListItem>

            <ListItem>
              <FormControl fullWidth size='small'>
                <InputLabel id='diet-label'>Diet Definitions</InputLabel>
                <Select
                  labelId='diet-label'
                  id='diet'
                  value={filters.type}
                  label='Diet Definitions'
                  onChange={(next) => {
                    setFilters((filters) => ({ ...filters, diet: next.target.value }));
                  }}
                >
                  <MenuItem value={'main course'}>Gluten Free</MenuItem>
                  <MenuItem value={'ketogenic'}>Ketogenic</MenuItem>
                  <MenuItem value={'vegetarian'}>Vegetarian</MenuItem>
                  <MenuItem value={'lacto-vegetarianer'}>Lacto-Vegetarian</MenuItem>
                  <MenuItem value={'ovo-vegetarian'}>Ovo-Vegetarian</MenuItem>
                  <MenuItem value={'vegan'}>Vegan</MenuItem>
                  <MenuItem value={'pescetarian'}>Pescetarian</MenuItem>
                  <MenuItem value={'paleo'}>Paleo</MenuItem>
                  <MenuItem value={'primal'}>Primal</MenuItem>
                  <MenuItem value={'low FODMAP'}>Low FODMAP</MenuItem>
                  <MenuItem value={'whole30'}>Whole30</MenuItem>
                </Select>
              </FormControl>
            </ListItem>
            {Array.from(Array(8)).map((_, index) => (
              <ListItem key={index}>
                <FormControl fullWidth size='small'>
                  <InputLabel id='demo-select-small-label'>Cuisine</InputLabel>
                  <Select
                    labelId='demo-select-small-label'
                    id='demo-select-small'
                    value={5}
                    label='Cuisine'
                    onChange={(next) => {
                      console.log(next);
                    }}
                  >
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                  </Select>
                </FormControl>
              </ListItem>
            ))}
          </List>

          <Divider />
        </div>
      </Drawer>
    </Box>
  );
};
